import React from 'react';
import './About.css';
import Photo from '../../media/Photo3.jpg'



const About = () => {
  return (
    <div className='about-container'>
        <div className='about-desc'>
            <h3>Sobre mi</h3>
        <p>Programador Junior con conocimiento intermedio en Excel, software y hardware adicionalmente cuento con conocimientos en lenguaje de programación como Python (Flask, Django), Java, JavaScript, CSS, SQL, PostgreSQL, NodeJS, manejo de frameworks (Vue, React, Angular) metodologías agiles (SCRUM), JSON Web Tokens, GIT, API Rest, todos estos conocimientos los adquirí por medio del programa del gobierno Misión TIC 2022 con la Universidad Nacional de Colombia.</p>
        </div>
        <div className='about-img'>
          <img className='photo' src = {Photo}/>
        </div>
    </div>
  )
}


export default About
